export default function registra(item){
    const cargoUtil = JSON.stringify(item);
    var registrado = false;
    alert(cargoUtil);
    fetch("http://localhost/registrarse.php",{
        method:"POST",
        headers: {
            "Content-Type":'application/json'
        },
        body: cargoUtil
    }).then(res=>{
        if(!res.ok) alert(res)
        return res.json()
    }).then((res)=>{
        if(res) alert("Registre correcte")
    }).catch(e => alert(e));

    return registrado;
}
